import React from 'react';
import { Link } from 'react-router-dom';

const Home: React.FC = () => {
  return (
    <div className="bg-white bg-opacity-80 shadow-xl rounded-lg p-8 backdrop-blur-md">
      <h1 className="text-4xl font-bold mb-6 text-blue-600">Welcome to MediAssist AI</h1>
      <p className="mb-8 text-gray-700 text-lg">
        MediAssist AI is a cutting-edge medical application that leverages artificial intelligence to assist healthcare professionals in diagnosis, report generation, and treatment planning.
      </p>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <Link to="/diagnosis" className="bg-gradient-to-r from-blue-500 to-blue-600 p-6 rounded-lg hover:shadow-lg transition-all duration-300 transform hover:-translate-y-1">
          <h2 className="text-2xl font-semibold mb-3 text-white">Diagnosis</h2>
          <p className="text-blue-100">Upload X-ray images and patient data for AI-assisted diagnosis.</p>
        </Link>
        <Link to="/synthetic-report" className="bg-gradient-to-r from-green-500 to-green-600 p-6 rounded-lg hover:shadow-lg transition-all duration-300 transform hover:-translate-y-1">
          <h2 className="text-2xl font-semibold mb-3 text-white">Synthetic Report</h2>
          <p className="text-green-100">Generate synthetic medical reports for research and training purposes.</p>
        </Link>
        <Link to="/treatment-plan" className="bg-gradient-to-r from-purple-500 to-purple-600 p-6 rounded-lg hover:shadow-lg transition-all duration-300 transform hover:-translate-y-1">
          <h2 className="text-2xl font-semibold mb-3 text-white">Treatment Plan</h2>
          <p className="text-purple-100">Create personalized treatment plans based on patient data.</p>
        </Link>
      </div>
    </div>
  );
};

export default Home;
